"},{"id":"2","name":"Script snippet #2","content":"function meatMaker ()
{
    this.meat = "MEAT";
}

var loser = {};
console.log("before - " + loser.meat);
meatMaker.apply(loser);
console.log("after - " + loser.meat);

var losers = [{name: 'Abbey'}, {name: 'Bort'}, {name: 'Chrissy'}];

function meatMakerForArrays ()
{
    for (var i=0; i<this.length; ++i)
    {
        meatMaker.apply(losers[i]);
    }
}

losers.meatMaker = meatMakerForArrays;
losers.meatMaker();

for (var i=0; i<losers.length; ++i)
{
    console.log(losers[i].name + ' ' + losers[i].meat);
}


